import React from "react";
import {
  Table,
  TableHeader,
  TableColumn,
  TableBody,
  TableRow,
  TableCell,
  getKeyValue,
} from "@nextui-org/react";

const rows = [
  {
    key: "1",
    name: "Tony Reichert",
    address: "Rue de la rue 41 Bruxelles",
    status: "Admin",
  },
  {
    key: "2",
    name: "Zoey Lang",
    address: "Chaussée de waterloo 123 Waterloo",
    status: "Refused",
  },
  {
    key: "3",
    name: "Jane Fisher",
    address: "Avenue Namur 12 Bruxelles",
    status: "Admin",
  },
  {
    key: "4",
    name: "William Howard",
    address: "Rue de eden 41 Uccle",
    status: "Refused",
  },
];

const columns = [
  {
    key: "name",
    label: "NAME",
  },
  {
    key: "address",
    label: "ADDRESS",
  },
  {
    key: "status",
    label: "STATUS",
  },
];

const TableRowsClient = [
  {
    key: "1",
    name: "Tony Reichert",
    address: "Rue de la rue 41 Bruxelles",
    status: "Admin",
  },
  {
    key: "2",
    name: "Zoey Lang",
    address: "Chaussée de waterloo 123 Waterloo",
    status: "Refused",
  },
  {
    key: "3",
    name: "Jane Fisher",
    address: "Avenue Namur 12 Bruxelles",
    status: "Admin",
  },
  {
    key: "4",
    name: "William Howard",
    address: "Rue de eden 41 Uccle",
    status: "Refused",
  },
];

const columnsClient = [
  {
    key: "name",
    label: "NAME",
  },
  {
    key: "address",
    label: "ADDRESS",
  },
  {
    key: "status",
    label: "STATUS",
  },
];

function DashboardAdmin() {
  return (
    <div>
      <h1>Employee Table</h1>
      <Table aria-label="Example table with dynamic content">
        <TableHeader columns={columns}>
          {(column) => (
            <TableColumn key={column.key}>{column.label}</TableColumn>
          )}
        </TableHeader>
        <TableBody items={rows}>
          {(item) => (
            <TableRow key={item.key}>
              {(columnKey) => (
                <TableCell>{getKeyValue(item, columnKey)}</TableCell>
              )}
            </TableRow>
          )}
        </TableBody>
      </Table>


      <h1>Client Table</h1>
      <Table aria-label="Example table with dynamic content">
        <TableHeader columnsClient={columnsClient}>
          {(columnClient) => (
            <TableColumnClient key={columnClient.key}>{columnClient.label}</TableColumnClient>
          )}
        </TableHeader>
        <TableClientBody items={rows}>
          {(item) => (
            <TableRowClient key={item.key}>
              {(columnClientKey) => (
                <TableClientCell>{getKeyValue(item, columnClientKey)}</TableClientCell>
              )}
            </TableRowClient>
          )}
        </TableClientBody>
      </Table>
    </div>
  );
}

export default DashboardAdmin;
